let globalBrowser = null;

async function getBrowser() {
    if (!globalBrowser || !globalBrowser.isConnected()) {
        console.log("ðŸš€ Launching New Browser Instance...");
        globalBrowser = await puppeteer.launch({
            headless: 'new',
            args: [
                '--no-sandbox', 
                '--disable-setuid-sandbox',
                '--disable-dev-shm-usage', // à¸¥à¸”à¸à¸²à¸£à¸à¸´à¸™ Ram à¹ƒà¸™ Container/Server
                '--disable-gpu'
            ]
        });
    }
    return globalBrowser;
}

function formatDateThai(dateStr) {
    if (!dateStr) return "";
    let day, month, year;
    dateStr = dateStr.split(' ')[0]; 

    if (dateStr.includes('/')) {
        [day, month, year] = dateStr.split('/');
    } else if (dateStr.includes('-')) {
        [day, month, year] = dateStr.split('-');
    } else {
        return dateStr;
    }

    const thaiMonths = ["à¸¡.à¸„.", "à¸.à¸ž.", "à¸¡à¸µ.à¸„.", "à¹€à¸¡.à¸¢.", "à¸ž.à¸„.", "à¸¡à¸´.à¸¢.", "à¸.à¸„.", "à¸ª.à¸„.", "à¸.à¸¢.", "à¸•.à¸„.", "à¸ž.à¸¢.", "à¸˜.à¸„."];
    const monthIndex = parseInt(month, 10) - 1;
    const dayInt = parseInt(day, 10);

    if (monthIndex >= 0 && monthIndex < 12) {
        return `${dayInt} ${thaiMonths[monthIndex]} ${year}`;
    }
    return dateStr;
}

